pub fn checkMessage(message: []const u8) bool {
    if (message.len <= message_prefix.len) {
        return false;
    }
    return mem.eql(u8, message_prefix, message[0..message_prefix.len]);
}

pub fn bubbleSort(message: []u8) void {
    var i: u8 = 0;
    while (i < message.len - 1) : (i += 1) {
        var j = i + 1;
        while (j < message.len) : (j += 1) {
            if (message[i] > message[j]) {
                var tmp = message[i];
                message[i] = message[j];
                message[j] = tmp;
            }
        }
    }
}

pub fn getOrder(message: []const u8) u8 {
    var copy_message = [_]u8{ 0, 0, 0 };
    mem.copy(u8, &copy_message, message);
    bubbleSort(&copy_message);
    const mat6x3 = [6][3]u8{
        [_]u8{ 0, 1, 2 },
        [_]u8{ 0, 2, 1 },
        [_]u8{ 1, 0, 2 },
        [_]u8{ 1, 2, 0 },
        [_]u8{ 2, 0, 1 },
        [_]u8{ 2, 1, 0 },
    };
    for (mat6x3) |order, idx| {
        const arr: [3]u8 = .{
            copy_message[order[0]],
            copy_message[order[1]],
            copy_message[order[2]],
        };
        if (mem.eql(u8, message, &arr)) {
            return @intCast(u8, idx);
        }
    }
    return 0xff;
}

pub fn reOrder(message: []u8, order: u8) void {
    const mat6x3 = [6][3]u8{
        [_]u8{ 0, 1, 2 },
        [_]u8{ 0, 2, 1 },
        [_]u8{ 1, 0, 2 },
        [_]u8{ 1, 2, 0 },
        [_]u8{ 2, 0, 1 },
        [_]u8{ 2, 1, 0 },
    };
    const arr: [3]u8 = .{
        message[mat6x3[order][0]],
        message[mat6x3[order][1]],
        message[mat6x3[order][2]],
    };
    mem.copy(u8, message, &arr);
}

pub fn encodeToZigPattern(allocator:* Allocator, random_seed: usize, message: []const u8) ![]u8 {
    if (message.len != 90) {
        return error.InvalidLength;
    }

    const color_indexes = [_]usize{ 6752, 17999, 29058, 40115, 51174, 61856, 72393, 82935, 93584, 104197, 114735, 125269, 135811, 146358, 156893, 167429, 177970, 188508, 199047, 209589, 220127, 230668, 241212, 251752, 262294, 272839, 283381, 293925, 304470, 315009 };

    const stdout = std.io.getStdOut().writer();
    var needle = "666666";
    var i: usize = 0;

    var buf = try allocator.alloc(u8, svg_template.len);
    var fbs = std.io.fixedBufferStream(buf);

    for (color_indexes) |index, idx| {
        var a = message[3 * idx];
        var b = message[3 * idx + 1];
        var c = message[3 * idx + 2];
        var copy_message = [_]u8{ a, b, c };
        var prng = std.rand.DefaultPrng.init(random_seed+%index+%idx);
        const order = prng.random.intRangeLessThan(u8, 0, 6);
        reOrder(&copy_message, order);

        while (i < svg_template.len) {
            if (i == index + 42) {
                try std.fmt.format(fbs.writer(),"{d}", .{order});
                i += 1;
                break;
            } else if (i == index) {
                try std.fmt.format(fbs.writer(),"{x:0>2}{x:0>2}{x:0>2}", .{copy_message[0],copy_message[1],copy_message[2]} );
                i += 6;
            } else {
                try fbs.writer().writeAll(svg_template[i .. i + 1]);
                i += 1;
            }
        }
    }
    while(i<svg_template.len):(i+=1){
        try fbs.writer().writeAll(svg_template[i .. i + 1]);
    }
    
    return fbs.getWritten();
}

pub fn encryptMessage(allocator: *Allocator, poly: u128, init_vector: u128, message: []const u8) ![]const u8 {
    var current_vector = init_vector;

    var memory = try allocator.alloc(u8, message.len);
    const stdout = std.io.getStdOut().writer();

    for (message) |each, idx| {
        var byte: u8 = 0;
        var i: u4 = 0;
        while (i < 8) : (i += 1) {
            const bit: u1 = @intCast(u1, (current_vector >> 127));
            var masked = current_vector & poly;
            var new_bit: u1 = 0;
            var j: u8 = 0;
            while (j < 128) : (j += 1) {
                new_bit +%= @intCast(u1, masked & 1);
                masked >>= 1;
            }
            current_vector = (current_vector << 1) | new_bit;
            byte = (byte << 1) | @as(u8, bit);
        }
        memory[idx] = each ^ byte;
    }

    return memory;
}

pub fn main() anyerror!void {
    const stdout = std.io.getStdOut().writer();
    const stdin = std.io.getStdIn().reader();
    const flag_length = 90 - message_prefix.len;

    try stdout.print("{}\n\nInput the key:", .{welcome_message});

    var key_buf: [80]u8 = undefined;
    var message_buf: [message_prefix.len + flag_length + 1]u8 = undefined;
    if (stdin.readUntilDelimiterOrEof(&key_buf, '\n') catch |err| {
        try stdout.print("Error reading from input: {}\n", .{err});
        return;
    }) |line_key| {
        const actual_line_key = mem.trimRight(u8, line_key, "\r\n ");
        var poly_str: []const u8 = undefined;
        var init_vector_str: []const u8 = undefined;
        if (getPos(u8, actual_line_key, ',')) |idx| {
            if ((idx == 0) or (idx == actual_line_key.len - 1)) {
                try stdout.print(invalid_key_msg, .{});
                return;
            }
            poly_str = actual_line_key[0..idx];
            init_vector_str = actual_line_key[idx + 1 ..];
        } else {
            try stdout.print(invalid_key_msg, .{});
            return;
        }

        const poly = std.fmt.parseInt(u128, poly_str, 10) catch |_| {
            try stdout.print(invalid_key_msg, .{});
            return;
        };
        const init_vector = std.fmt.parseInt(u128, init_vector_str, 10) catch |_| {
            try stdout.print(invalid_key_msg, .{});
            return;
        };

        try stdout.print("Input the message:", .{});

        if (stdin.readUntilDelimiterOrEof(&message_buf, '\n') catch |_| {
            try stdout.print("Invalid message.\n", .{});
            return;
        }) |line_message| {
            const trimed_message = mem.trimRight(u8, line_message, "\r\n ");
            if (!checkMessage(trimed_message)) {
                try stdout.print("Invalid message format.\n", .{});
                return;
            }
            var message:[90]u8 = [_]u8{0}**90;
            var max:usize = 90;
            if(trimed_message.len < max){
                max = trimed_message.len;
            }
            var i:usize = 0;
            while(i<max):(i+=1){
                message[i] = trimed_message[i];
            }

            const enc = try encryptMessage(my_allocator, poly, init_vector, &message);
            defer my_allocator.free(enc);

            try stdout.print("Your key:{x},{} your message: {}, len:{}\n", .{ poly, init_vector, message, message.len });

            const buf = encodeToZigPattern(my_allocator, @intCast(usize, poly>>64), enc) catch |err| {
                expect(err == error.InvalidLength);
                return;
            };
            defer my_allocator.free(buf);

            try std.fs.cwd().writeFile("zigzag.svg", buf);
            try stdout.print("Done.\n",.{});

        }
    }
}
